INSERT INTO `egg_variables` VALUES (1,1,'Server Jar File','The name of the Jarfile to use when running Forge version below 1.17.','SERVER_JARFILE','server.jar',1,1,'required|regex:/^([\\w\\d._-]+)(\\.jar)$/','2023-06-12 23:27:13','2023-06-12 23:27:13'),(2,1,'Minecraft Version','The version of minecraft you want to install for.\r\n\r\nLeaving latest will install the latest recommended version.','MC_VERSION','latest',1,1,'required|string|max:9','2023-06-12 23:27:13','2023-06-12 23:27:13'),(3,1,'Build Type','The type of server jar to download from forge.\r\n\r\nValid types are \"recommended\" and \"latest\".','BUILD_TYPE','recommended',1,1,'required|string|in:recommended,latest','2023-06-12 23:27:13','2023-06-12 23:27:13'),(4,1,'Forge Version','The full exact version.\r\n\r\nEx. 1.15.2-31.2.4\r\n\r\nOverrides MC_VERSION and BUILD_TYPE. If it fails to download the server files it will fail to install.','FORGE_VERSION','',1,1,'nullable|regex:/^[0-9\\.\\-]+$/','2023-06-12 23:27:13','2023-06-12 23:27:13'),(5,2,'Sponge Version','The version of SpongeVanilla to download and use.','SPONGE_VERSION','1.12.2-7.3.0',1,1,'required|regex:/^([a-zA-Z0-9.\\-_]+)$/','2023-06-12 23:27:13','2023-06-12 23:27:13'),(6,2,'Server Jar File','The name of the Jarfile to use when running SpongeVanilla.','SERVER_JARFILE','server.jar',1,1,'required|regex:/^([\\w\\d._-]+)(\\.jar)$/','2023-06-12 23:27:13','2023-06-12 23:27:13'),(7,3,'Server Jar File','The name of the server jarfile to run the server with.','SERVER_JARFILE','server.jar',1,1,'required|regex:/^([\\w\\d._-]+)(\\.jar)$/','2023-06-12 23:27:13','2023-06-12 23:27:13'),(8,3,'Server Version','The version of Minecraft Vanilla to install. Use \"latest\" to install the latest version, or use \"snapshot\" to install the latest snapshot. Go to Settings > Reinstall Server to apply.','VANILLA_VERSION','latest',1,1,'required|string|between:3,15','2023-06-12 23:27:13','2023-06-12 23:27:13'),(9,4,'Bungeecord Version','The version of Bungeecord to download and use.','BUNGEE_VERSION','latest',1,1,'required|alpha_num|between:1,6','2023-06-12 23:27:13','2023-06-12 23:27:13'),(10,4,'Bungeecord Jar File','The name of the Jarfile to use when running Bungeecord.','SERVER_JARFILE','bungeecord.jar',1,1,'required|regex:/^([\\w\\d._-]+)(\\.jar)$/','2023-06-12 23:27:13','2023-06-12 23:27:13'),(11,5,'Minecraft Version','The version of minecraft to download. \r\n\r\nLeave at latest to always get the latest version. Invalid versions will default to latest.','MINECRAFT_VERSION','latest',1,1,'nullable|string|max:20','2023-06-12 23:27:13','2023-06-12 23:27:13'),(12,5,'Server Jar File','The name of the server jarfile to run the server with.','SERVER_JARFILE','server.jar',1,1,'required|regex:/^([\\w\\d._-]+)(\\.jar)$/','2023-06-12 23:27:13','2023-06-12 23:27:13'),(13,5,'Download Path','A URL to use to download a server.jar rather than the ones in the install script. This is not user viewable.','DL_PATH','',0,0,'nullable|string','2023-06-12 23:27:13','2023-06-12 23:27:13'),(14,5,'Build Number','The build number for the paper release.\r\n\r\nLeave at latest to always get the latest version. Invalid versions will default to latest.','BUILD_NUMBER','latest',1,1,'required|string|max:20','2023-06-12 23:27:13','2023-06-12 23:27:13'),(15,6,'Map','The default map for the server.','SRCDS_MAP','de_dust2',1,1,'required|string|alpha_dash','2023-06-12 23:27:13','2023-06-12 23:27:13'),(16,6,'Steam Account Token','The Steam Account Token required for the server to be displayed publicly.','STEAM_ACC','',1,1,'required|string|alpha_num|size:32','2023-06-12 23:27:13','2023-06-12 23:27:13'),(17,6,'Source AppID','Required for game to update on server restart. Do not modify this.','SRCDS_APPID','740',0,0,'required|string|max:20','2023-06-12 23:27:13','2023-06-12 23:27:13'),(18,7,'Game ID','The ID corresponding to the game to download and run using SRCDS.','SRCDS_APPID','',1,0,'required|numeric|digits_between:1,6','2023-06-12 23:27:13','2023-06-12 23:27:13'),(19,7,'Game Name','The name corresponding to the game to download and run using SRCDS.','SRCDS_GAME','',1,0,'required|alpha_dash|between:1,100','2023-06-12 23:27:13','2023-06-12 23:27:13'),(20,7,'Map','The default map for the server.','SRCDS_MAP','',1,1,'required|string|alpha_dash','2023-06-12 23:27:13','2023-06-12 23:27:13'),(21,7,'Steam Username','','STEAM_USER','',1,1,'nullable|string','2023-06-12 23:27:13','2023-06-12 23:27:13'),(22,7,'Steam Password','','STEAM_PASS','',1,1,'nullable|string','2023-06-12 23:27:13','2023-06-12 23:27:13'),(23,7,'Steam Auth','','STEAM_AUTH','',1,1,'nullable|string','2023-06-12 23:27:13','2023-06-12 23:27:13'),(24,8,'Map','The default map for the server.','SRCDS_MAP','gm_flatgrass',1,1,'required|string|alpha_dash','2023-06-12 23:27:13','2023-06-12 23:27:13'),(25,8,'Steam Account Token','The Steam Account Token required for the server to be displayed publicly.','STEAM_ACC','',1,1,'nullable|string|alpha_num|size:32','2023-06-12 23:27:13','2023-06-12 23:27:13'),(26,8,'Source AppID','Required for game to update on server restart. Do not modify this.','SRCDS_APPID','4020',0,0,'required|string|max:20','2023-06-12 23:27:13','2023-06-12 23:27:13'),(27,8,'Workshop ID','The ID of your workshop collection (the numbers at the end of the URL)','WORKSHOP_ID','',1,1,'nullable|integer','2023-06-12 23:27:13','2023-06-12 23:27:13'),(28,8,'Gamemode','The gamemode of your server.','GAMEMODE','sandbox',1,1,'required|string','2023-06-12 23:27:13','2023-06-12 23:27:13'),(29,8,'Max Players','The maximum amount of players allowed on your game server.','MAX_PLAYERS','32',1,1,'required|integer|max:128','2023-06-12 23:27:13','2023-06-12 23:27:13'),(30,8,'Tickrate','The tickrate defines how fast the server will update each entity\'s location.','TICKRATE','22',1,1,'required|integer|max:100','2023-06-12 23:27:13','2023-06-12 23:27:13'),(31,8,'Lua Refresh','0 = disable Lua refresh,\r\n1 = enable Lua refresh','LUA_REFRESH','0',1,1,'required|boolean','2023-06-12 23: