ired|numeric','2023-06-12 23:27:13','2023-06-12 23:27:13'),(42,11,'Query Port','ARK query port used by steam server browser and ark client server browser.','QUERY_PORT','27015',1,1,'required|numeric','2023-06-12 23:27:13','2023-06-12 23:27:13'),(43,11,'Auto-update server','This is to enable auto-updating for servers.\r\n\r\nDefault is 0. Set to 1 to update','AUTO_UPDATE','0',1,1,'required|boolean','2023-06-12 23:27:13','2023-06-12 23:27:13'),(44,11,'Battle Eye','Enable BattleEye\r\n\r\n0 to disable\r\n1 to enable\r\n\r\ndefault=\"1\"','BATTLE_EYE','1',1,1,'required|boolean','2023-06-12 23:27:13','2023-06-12 23:27:13'),(45,11,'App ID','ARK steam app id for auto updates. Leave blank to avoid auto update.','SRCDS_APPID','376030',1,0,'nullable|numeric','2023-06-12 23:27:13','2023-06-12 23:27:13'),(46,11,'Additional Arguments','Specify additional launch parameters such as -crossplay. You must include a dash - and separate each parameter with space: -crossplay -exclusivejoin','ARGS','',1,1,'nullable|string','2023-06-12 23:27:13','2023-06-12 23:27:13'),(47,12,'Maximum Users','Maximum concurrent users on the mumble server.','MAX_USERS','100',1,0,'required|numeric|digits_between:1,5','2023-06-12 23:27:13','2023-06-12 23:27:13'),(48,13,'Server Version','The version of Teamspeak 3 to use when running the server.','TS_VERSION','latest',1,1,'required|string|max:6','2023-06-12 23:27:13','2023-06-12 23:27:13'),(49,13,'File Transfer Port','The Teamspeak file transfer port','FILE_TRANSFER','30033',1,0,'required|integer|between:1025,65535','2023-06-12 23:27:13','2023-06-12 23:27:13'),(50,13,'Query Port','The Teamspeak Query Port','QUERY_PORT','10011',1,0,'required|integer|between:1025,65535','2023-06-12 23:27:13','2023-06-12 23:27:13'),(51,13,'Query Protocols','Comma separated list of protocols that can be used to connect to the ServerQuery | \r\nPossible values are raw, ssh and http | \r\nE.g.: raw,ssh,http','QUERY_PROTOCOLS_VAR','raw,http,ssh',1,1,'required|string|max:12','2023-06-12 23:27:13','2023-06-12 23:27:13'),(52,13,'Query SSH Port','TCP Port opened for ServerQuery connections using SSH','QUERY_SSH','10022',1,0,'required|integer|between:1025,65535','2023-06-12 23:27:13','2023-06-12 23:27:13'),(53,13,'Query HTTP Port','TCP Port opened for ServerQuery connections using http','QUERY_HTTP','10080',1,0,'required|integer|between:1025,65535','2023-06-12 23:27:13','2023-06-12 23:27:13'),(54,14,'Server Name','The name of your server in the public server list.','HOSTNAME','A Rust Server',1,1,'required|string|max:60','2023-06-12 23:27:13','2023-06-12 23:27:13'),(55,14,'OxideMod','Set whether you want the server to use and auto update OxideMod or not. Valid options are \"1\" for true and \"0\" for false.','OXIDE','0',1,1,'required|boolean','2023-06-12 23:27:13','2023-06-12 23:27:13'),(56,14,'Level','The world file for Rust to use.','LEVEL','Procedural Map',1,1,'required|string|max:20','2023-06-12 23:27:13','2023-06-12 23:27:13'),(57,14,'Description','The description under your server title. Commonly used for rules & info. Use \\n for newlines.','DESCRIPTION','Powered by Pterodactyl',1,1,'required|string','2023-06-12 23:27:13','2023-06-12 23:27:13'),(58,14,'URL','The URL for your server. This is what comes up when clicking the \"Visit Website\" button.','SERVER_URL','http://pterodactyl.io',1,1,'nullable|url','2023-06-12 23:27:13','2023-06-12 23:27:13'),(59,14,'World Size','The world size for a procedural map.','WORLD_SIZE','3000',1,1,'required|integer','2023-06-12 23:27:13','2023-06-12 23:27:13'),(60,14,'World Seed','The seed for a procedural map.','WORLD_SEED','',1,1,'nullable|string','2023-06-12 23:27:13','2023-06-12 23:27:13'),(61,14,'Max Players','The maximum amount of players allowed in the server at once.','MAX_PLAYERS','40',1,1,'required|integer','2023-06-12 23:27:13','2023-06-12 23:27:13'),(62,14,'Server Image','The header image for the top of your server listing.','SERVER_IMG','',1,1,'nullable|url','2023-06-12 23:27:13','2023-06-12 23:27:13'),(63,14,'RCON Port','Port for RCON connections.','RCON_PORT','28016',1,0,'required|integer','2023-06-12 23:27:14','2023-06-12 23:27:14'),(64,14,'RCON Password','RCON access password.','RCON_PASS','CHANGEME',1,1,'required|regex:/^[\\w.-]*$/|max:64','2023-06-12 23:27:14','2023-06-12 23:27:14'),(65,14,'Save Interval','Sets the servers auto-save interval in seconds.','SAVEINTERVAL','60',1,1,'required|integer','2023-06-12 23:27:14','2023-06-12 23:27:14'),(66,14,'Additional Arguments','Add additional startup parameters to the server.','ADDITIONAL_ARGS','',1,1,'nullable|string','2023-06-12 23:27:14','2023-06-12 23:27:14'),(67,14,'App Port','Port for the Rust+ App. -1 to disable.','APP_PORT','28082',1,0,'required|integer','2023-06-12 23:27:14','2023-06-12 23:27:14'),(68,14,'Server Logo','The circular server logo for the Rust+ app.','SERVER_LOGO','',1,1,'nullable|url','2023-06-12 23:27:14','2023-06-12 23:27:14'),(69,14,'Custom Map URL','Overwrites the map with the one from the direct download URL. Invalid URLs will cause the server to crash.','MAP_URL','',1,1,'nullable|url','2023-06-12 23:27:14','2023-06-12 23:27:14');
